import React from 'react'
import { useSelector } from 'react-redux'
import Fullcart from '../components/Cart/Fullcart'


  
const Cart = () => {
  const { cart } = useSelector((state) => state)

  return (
    <div>
      {
        cart.length>0?<Fullcart/>:('nahi hai')
      }
    </div>
  )
}

export default Cart
